import React, { Component } from 'react'
import { connect } from 'react-redux';
import { MDBBtn, MDBIcon, MDBView } from 'mdbreact';
import ContactCard from './ContactCard';
import { NavLink, BrowserRouter as Router } from 'react-router-dom';

class ContactList extends Component {
    state = {
    }
    render() {
        return (
            <MDBView src="https://mdbootstrap.com/img/Photos/Others/img%20(42).jpg">
                <NavLink exact to={`/`}>
                    <MDBBtn gradient="blue"><MDBIcon icon="home" fixed /> </MDBBtn>
                </NavLink>
                <h2 className="text-center text-white " >Contact List page</h2>
                <div className="container ">
                    <div className="row ">
                        {this.props.initState.map((el, i) => <ContactCard key={i} contact={el} />)}
                    </div>
                </div>
            </MDBView>
        )
    }
}

const mapStateToProps = state => {
    return {
        initState: state.Reducer
    };
};

export default connect(mapStateToProps)(ContactList)
